// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract GetTokenFaucet {
    address public owner;
    mapping(address => uint256) public lastClaim;
    uint256 public claimInterval = 12 hours;
    uint256 public amount = 100 * 10**18; // Adjust based on token decimals

    IERC20 public LNX;
    IERC20 public CEP;

    event FaucetClaimed(address indexed user, address token, uint256 amount);
    event OwnerWithdrawal(address indexed owner, address token, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not the owner");
        _;
    }

    constructor(address _lnx, address _cep) {
        owner = msg.sender;
        LNX = IERC20(_lnx);
        CEP = IERC20(_cep);
    }

    function claim(address token) external {
        require(token == address(LNX) || token == address(CEP), "Invalid token");
        uint256 nextClaimTime = lastClaim[msg.sender] + claimInterval;
        require(block.timestamp >= nextClaimTime, string(abi.encodePacked("Wait until ", timestampToDateTime(nextClaimTime))));

        lastClaim[msg.sender] = block.timestamp;

        uint256 contractBalance = IERC20(token).balanceOf(address(this));
        require(contractBalance >= amount, "Not enough tokens in faucet");

        require(IERC20(token).transfer(msg.sender, amount), "Token transfer failed");
        emit FaucetClaimed(msg.sender, token, amount);
    }

    function setAmount(uint256 _amount) external onlyOwner {
        amount = _amount;
    }

    function setClaimInterval(uint256 _interval) external onlyOwner {
        claimInterval = _interval;
    }

    function withdrawTokens(address token, uint256 _amount) external onlyOwner {
        uint256 contractBalance = IERC20(token).balanceOf(address(this));
        require(_amount <= contractBalance, "Insufficient contract balance");

        require(IERC20(token).transfer(owner, _amount), "Token withdrawal failed");
        emit OwnerWithdrawal(owner, token, _amount);
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner is the zero address");
        owner = newOwner;
    }

    function timestampToDateTime(uint256 timestamp) internal pure returns (string memory) {
        uint256 year = 1970 + timestamp / 31556952;
        uint256 month = (timestamp % 31556952) / 2629746 + 1;
        uint256 day = ((timestamp % 31556952) % 2629746) / 86400 + 1;
        uint256 hour = (timestamp % 86400) / 3600;
        uint256 minute = (timestamp % 3600) / 60;
        uint256 second = timestamp % 60;

        return string(abi.encodePacked(
            uintToString(year), "-",
            uintToString(month), "-",
            uintToString(day), " ",
            uintToString(hour), ":",
            uintToString(minute), ":",
            uintToString(second)
        ));
    }

    function uintToString(uint256 _value) internal pure returns (string memory) {
        if (_value == 0) {
            return "0";
        }
        uint256 temp = _value;  // Use a local variable instead of modifying _value
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        temp = _value;  // Reset temp to the original value
        while (temp != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(temp % 10)));
            temp /= 10;
        }
        return string(buffer);
    }
}

